\u0412\u043e\u043f\u0440\u043e\u0441 1.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
Пословица "Первый блин комом" изначально не имела отношения к неудачам;
в древнеславянском языке слово "ком" означало медведя, покровителя рода,
которому и посвящали первый блин с целью задабривания.

\u0412\u043e\u043f\u0440\u043e\u0441 104.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
Бессонова - абсолютная чемпионка мира по художественной гимнастике;
многие гимнастки при работе с булавами получают травмы, и у самой
Бессоновой до сих пор шрам на губе.
